body:
I believe this is the issue: https://github.com/dcleblanc/SafeInt/issues/37

I'm not sure how the iOS dependencies work and what the best fix is. From the sound of it you can safely delete the CastThrow method as per this change: https://github.com/dcleblanc/SafeInt/commit/ff15c6ada150a5018c5ef2172401cb4529eac9c0

@edgchen1 Can we remove SafeInt.hpp from the pod? I didn't see any direct usage of SafeInt in the objective-c api. There's an include of SafeInt.hpp in ort_value.mm but no actual usage.
